# 1 "Lex.fsl"
 
 (* File MicroC/CLex.lex
    Lexer specification for micro-C, a small imperative language
  *)

module CLex
  
open Microsoft.FSharp.Text.Lexing
open Microsoft.FSharp.Collections
open CPar;

let lexemeAsString lexbuf = 
    LexBuffer<char>.LexemeString lexbuf

(* Scan keywords as identifiers and use this function to distinguish them. *)
(* If the set of keywords is large, use a hashtable instead.               *)

let keyword s =
    match s with
    | "PI"      -> PI
    | "ItoF"    -> ITOF
    | "itof"    -> ITOF
    | "Float"   -> ITOF
    | "FtoI"    -> FTOI
    | "ftoi"    -> FTOI
    | "Int"     -> FTOI
    | "Sqrt"    -> SQRT
    | "Pow"     -> POW
    | "Log"     -> LOG
    | "Fabs"    -> FABS
    | "Sin"     -> SIN
    | "Cos"     -> COS
    | "Tan"     -> TAN
    | "Asin"    -> ASIN
    | "Acos"    -> ACOS
    | "Atan"    -> ATAN
    | "Round"   -> ROUND
    | "Floor"   -> FLOOR
    | "Ceil"    -> CEIL
    | "Gcd"     -> GCD
    | "Mcm"     -> MCM
    | "Abs"     -> ABS
    | "char"    -> CHAR 
    | "default" -> DEFAULT
    | "do"      -> DO
    | "else"    -> ELSE
    | "false"   -> CSTBOOL 0
    | "for"     -> FOR
    | "if"      -> IF
    | "int"     -> INT
    | "float"   -> FLOAT
    | "null"    -> NULL
    | "print"   -> PRINT
    | "printi"  -> PRINTI
    | "printc"  -> PRINTC
    | "printf"  -> PRINTF
    | "println" -> PRINTLN
    | "return"  -> RETURN
    | "true"    -> CSTBOOL 1
    | "void"    -> VOID 
    | "while"   -> WHILE     
    | "Sort"    -> SORT
    | "Max"     -> MAX
    | "Min"     -> MIN
    | "Swap"    -> SWAP
    | "switch"  -> SWITCH    
    | "case"    -> CASE
    | _         -> NAME s
 
let cEscape s = 
    match s with 
    | "\\\\" -> '\\'
    | "\\\"" -> '\"'
    | "\\a"  -> '\007'
    | "\\b"  -> '\008'
    | "\\t"  -> '\t'
    | "\\n"  -> '\n'
    | "\\v"  -> '\011'
    | "\\f"  -> '\012'
    | "\\r"  -> '\r'
    | _      -> failwith "Lexer error: impossible C escape"

